import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../contexts/AuthContext";
import { Profile } from "../types";
import "./MyPage.css";

const MyPage: React.FC = () => {
  const { user, isAuthenticated } = useAuth();
  const navigate = useNavigate();
  const [profile, setProfile] = useState<Profile | null>(null);
  const [isEditing, setIsEditing] = useState(false);
  const [isCardFlipped, setIsCardFlipped] = useState(false);

  useEffect(() => {
    if (!isAuthenticated) {
      navigate("/login");
      return;
    }

    // モックプロフィールデータ
    const mockProfile: Profile = {
      id: "1",
      userId: user?.id || "1",
      profileImageUrl:
        "https://via.placeholder.com/300x180/667eea/ffffff?text=Meetolio+名刺",
      jobTitle: "フロントエンドエンジニア",
      company: "株式会社テックソリューション",
      bio: "React、TypeScript、Node.jsを使用したWebアプリケーション開発に従事しています。ユーザー体験を重視したUI/UXデザインが得意です。新しい技術の習得と実践的なアプリケーション開発に情熱を持って取り組んでいます。",
      contactInfo: {
        email: user?.email || "test@example.com",
        phone: "090-1234-5678",
        sns: {
          twitter: "@techdev",
          linkedin: "linkedin.com/in/techdev",
          facebook: "facebook.com/techdev",
          instagram: "@techdev",
          github: "github.com/techdev",
        },
        website: "https://techdev.example.com",
      },
      skills: ["React", "TypeScript", "Node.js", "CSS", "Git"],
      interests: ["Web開発", "UI/UX", "技術書", "カンファレンス"],
      isPublic: true,
      createdAt: new Date(),
      updatedAt: new Date(),
    };

    setProfile(mockProfile);
  }, [isAuthenticated, user, navigate]);

  if (!isAuthenticated || !user) {
    return null;
  }

  if (!profile) {
    return (
      <div className="mypage">
        <div className="container">
          <div className="loading">読み込み中...</div>
        </div>
      </div>
    );
  }

  const handleCardFlip = () => {
    setIsCardFlipped(!isCardFlipped);
  };

  return (
    <div className="mypage">
      <div className="container">
        <div className="mypage-header">
          <h1>マイページ</h1>
          <div className="mypage-actions">
            <button
              onClick={() => setIsEditing(!isEditing)}
              className="btn btn-primary"
            >
              {isEditing ? "キャンセル" : "プロフィール編集"}
            </button>
            <Link to="/settings" className="btn btn-secondary">
              設定
            </Link>
          </div>
        </div>

        <div className="profile-section">
          {/* 名刺画像セクション */}
          <div className="business-card-section">
            <div className="card-container">
              <div 
                className={`business-card ${isCardFlipped ? 'flipped' : ''}`}
                onClick={handleCardFlip}
              >
                {/* 名刺の表面 */}
                <div className="card-front">
                  <div className="card-header">
                    <div className="company-info">
                      <h2 className="company-name">{profile.company}</h2>
                      <p className="company-details">Web Development Company</p>
                    </div>
                    <div className="card-status">
                      <span
                        className={`status-badge ${
                          profile.isPublic ? "public" : "private"
                        }`}
                      >
                        {profile.isPublic ? "公開" : "非公開"}
                      </span>
                    </div>
                  </div>

                  <div className="card-body">
                    <div className="contact-info-left">
                      <div className="contact-item">
                        <span className="contact-label">〒</span>
                        <span className="contact-value">100-0001</span>
                      </div>
                      <div className="contact-item">
                        <span className="contact-label">住所</span>
                        <span className="contact-value">東京都千代田区千代田1-1</span>
                      </div>
                      <div className="contact-item">
                        <span className="contact-label">TEL</span>
                        <span className="contact-value">03-1234-5678</span>
                      </div>
                      <div className="contact-item">
                        <span className="contact-label">FAX</span>
                        <span className="contact-value">03-1234-5679</span>
                      </div>
                      <div className="contact-item">
                        <span className="contact-label">Mobile</span>
                        <span className="contact-value">{profile.contactInfo.phone}</span>
                      </div>
                      <div className="contact-item">
                        <span className="contact-label">Email</span>
                        <span className="contact-value">{profile.contactInfo.email}</span>
                      </div>
                    </div>

                    <div className="personal-info-right">
                      <div className="job-title">{profile.jobTitle}</div>
                      <div className="person-name">{user.name}</div>
                      <div className="person-name-romaji">Frontend Engineer</div>
                    </div>
                  </div>

                  <div className="card-footer">
                    <p className="flip-hint">タップして裏面を見る</p>
                  </div>
                </div>

                {/* 名刺の裏面 */}
                <div className="card-back">
                  <div className="card-back-header">
                    <h3>自己紹介</h3>
                  </div>

                  <div className="card-back-content">
                    <div className="bio-text">
                      {profile.bio}
                    </div>

                    <div className="skills-section">
                      <h4>スキル</h4>
                      <div className="skills-tags">
                        {profile.skills.slice(0, 6).map((skill, index) => (
                          <span key={index} className="skill-tag-small">{skill}</span>
                        ))}
                      </div>
                    </div>

                    <div className="interests-section">
                      <h4>興味・関心</h4>
                      <div className="interests-tags">
                        {profile.interests.slice(0, 4).map((interest, index) => (
                          <span key={index} className="interest-tag-small">{interest}</span>
                        ))}
                      </div>
                    </div>
                  </div>

                  <div className="card-footer">
                    <p className="flip-hint">タップして表面に戻る</p>
                  </div>
                </div>
              </div>

              {isEditing && (
                <button className="image-upload-btn">📷 名刺デザイン変更</button>
              )}
            </div>
          </div>

          {/* 自己紹介セクション */}
          {profile.bio && (
            <div className="bio-section">
              <h3 className="section-title">自己紹介</h3>
              <div className="bio-content">
                <p>{profile.bio}</p>
              </div>
            </div>
          )}

          {/* SNSリンクセクション */}
          <div className="sns-section">
            <h3 className="section-title">SNS・連絡先</h3>
            <div className="sns-grid">
              {/* メール */}
              <a
                href={`mailto:${profile.contactInfo.email}`}
                className="sns-card email-card"
                target="_blank"
                rel="noopener noreferrer"
              >
                <div className="sns-icon">📧</div>
                <div className="sns-info">
                  <span className="sns-label">メール</span>
                  <span className="sns-value">{profile.contactInfo.email}</span>
                </div>
              </a>

              {/* 電話番号 */}
              {profile.contactInfo.phone && (
                <a
                  href={`tel:${profile.contactInfo.phone}`}
                  className="sns-card phone-card"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <div className="sns-icon">📞</div>
                  <div className="sns-info">
                    <span className="sns-label">電話番号</span>
                    <span className="sns-value">
                      {profile.contactInfo.phone}
                    </span>
                  </div>
                </a>
              )}

              {/* ウェブサイト */}
              {profile.contactInfo.website && (
                <a
                  href={profile.contactInfo.website}
                  className="sns-card website-card"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <div className="sns-icon">🌐</div>
                  <div className="sns-info">
                    <span className="sns-label">ウェブサイト</span>
                    <span className="sns-value">
                      {profile.contactInfo.website}
                    </span>
                  </div>
                </a>
              )}

              {/* Twitter */}
              {profile.contactInfo.sns?.twitter && (
                <a
                  href={`https://twitter.com/${profile.contactInfo.sns.twitter}`}
                  className="sns-card twitter-card"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <div className="sns-icon">🐦</div>
                  <div className="sns-info">
                    <span className="sns-label">Twitter</span>
                    <span className="sns-value">
                      {profile.contactInfo.sns.twitter}
                    </span>
                  </div>
                </a>
              )}

              {/* LinkedIn */}
              {profile.contactInfo.sns?.linkedin && (
                <a
                  href={`https://${profile.contactInfo.sns.linkedin}`}
                  className="sns-card linkedin-card"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <div className="sns-icon">💼</div>
                  <div className="sns-info">
                    <span className="sns-label">LinkedIn</span>
                    <span className="sns-value">
                      {profile.contactInfo.sns.linkedin}
                    </span>
                  </div>
                </a>
              )}

              {/* Facebook */}
              {profile.contactInfo.sns?.facebook && (
                <a
                  href={`https://${profile.contactInfo.sns.facebook}`}
                  className="sns-card facebook-card"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <div className="sns-icon">📘</div>
                  <div className="sns-info">
                    <span className="sns-label">Facebook</span>
                    <span className="sns-value">
                      {profile.contactInfo.sns.facebook}
                    </span>
                  </div>
                </a>
              )}

              {/* Instagram */}
              {profile.contactInfo.sns?.instagram && (
                <a
                  href={`https://instagram.com/${profile.contactInfo.sns.instagram}`}
                  className="sns-card instagram-card"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <div className="sns-icon">📷</div>
                  <div className="sns-info">
                    <span className="sns-label">Instagram</span>
                    <span className="sns-value">
                      {profile.contactInfo.sns.instagram}
                    </span>
                  </div>
                </a>
              )}

              {/* GitHub */}
              {profile.contactInfo.sns?.github && (
                <a
                  href={`https://github.com/${profile.contactInfo.sns.github}`}
                  className="sns-card github-card"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <div className="sns-icon">💻</div>
                  <div className="sns-info">
                    <span className="sns-label">GitHub</span>
                    <span className="sns-value">
                      {profile.contactInfo.sns.github}
                    </span>
                  </div>
                </a>
              )}
            </div>
          </div>

          {/* スキル・興味セクション */}
          <div className="skills-interests-section">
            <div className="skills-section">
              <h3 className="section-title">スキル・専門分野</h3>
              <div className="tags">
                {profile.skills.map((skill, index) => (
                  <span key={index} className="tag skill-tag">
                    {skill}
                  </span>
                ))}
              </div>
            </div>

            <div className="interests-section">
              <h3 className="section-title">趣味・興味</h3>
              <div className="tags">
                {profile.interests.map((interest, index) => (
                  <span key={index} className="tag interest-tag">
                    {interest}
                  </span>
                ))}
              </div>
            </div>
          </div>

          <div className="profile-footer">
            <p className="last-updated">
              最終更新: {profile.updatedAt.toLocaleDateString("ja-JP")}
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MyPage;
